public class Solution {
    public IList<string> FindHighAccessEmployees(IList<IList<string>> access_times) {
        var result = new HashSet<string>();
        var employeeAccessTimes = new Dictionary<string, List<int>>();

        foreach (var access in access_times) {
            var name = access[0];
            var time = int.Parse(access[1]);
            if (!employeeAccessTimes.ContainsKey(name)) {
                employeeAccessTimes[name] = new List<int>();
            }
            employeeAccessTimes[name].Add(time);
        }

        foreach (var employee in employeeAccessTimes) {
            var times = employee.Value;
            times.Sort();
            for (int i = 0; i < times.Count; i++) {
                int count = 1;
                for (int j = i + 1; j < times.Count; j++) {
                    if (times[j] - times[i] < 60) {
                        count++;
                        if (count >= 3) {
                            result.Add(employee.Key);
                            break;
                        }
                    } else {
                        break;
                    }
                }
            }
        }

        return result.ToList();
    }
}
